import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
  return (
    <nav className="fixed top-0 left-0 right-0 bg-white shadow-md z-10">
      <div className="max-w-3xl mx-auto px-4 py-3 flex items-center justify-between">
        <h1 className="text-xl font-semibold text-gray-900">ScamSafe</h1>
        <div className="flex space-x-6">
          <Link to="/" className="text-sm font-medium text-blue-600">Home</Link>
          <Link to="/help-advice" className="text-sm font-medium text-gray-600 hover:text-blue-600 transition-all">Help & Advice</Link>
          <Link to="/scam-trends" className="text-sm font-medium text-gray-600 hover:text-blue-600 transition-all">Scam Trends</Link>
          <Link to="/fraud-contacts" className="text-sm font-medium text-gray-600 hover:text-blue-600 transition-all">Fraud Contacts</Link>
        </div>
      </div>
    </nav>
  );
}

export default Nav;
